import React from "react";

export function UserRow({usuario}){
    return <tr>
        <td>{usuario.apenom}</td>
        <td>{usuario.dni}</td>
        <td>{usuario.idcargo}</td>
        <td>{usuario.admin == 1? 'SI' : 'NO'}</td>
    </tr>
}
